const isValidArgsForArithmatics = fn => {
    return (x,y) => {
        x = x || 0;
        y = y || 0;
        return fn(x,y);
    } 
}

const add = isValidArgsForArithmatics((x,y) => x+y);
const sub = isValidArgsForArithmatics((x,y) => x-y);
const mul = isValidArgsForArithmatics((x,y) => x*y);
const div = isValidArgsForArithmatics((x,y) => x/y);


// const add = (x,y) => x+y;

const negate = (p,x) => p.pushItem(x * -1);
const double = (p,x) => p.pushItem(x * 2);

const addArgs = (...args) =>  args.reduce(add); 
const subArgs = (...args) =>  args.reduce(sub); 
const negateArgs = (...args) =>  args.reduce(negate, []); 
const doubleArgs = (...args) =>  args.reduce(double, []); 

const isValidNumber = fn => x =>  typeof x != 'number' ? false : fn(x); 
const isPositive = isValidNumber(x => x > 0);
const isNegative = isValidNumber(x => x < 0);
const isEven = isValidNumber(x => x % 2 == 0);
const isOdd = isValidNumber(x => x % 2 != 0);

const allOk = (...fns) => (x) => fns.reduce((p,c) => c(p) ? p : c(p), x) == x;

const validateArrayandApply = fn => x => typeof x == 'string' ? fn(Array.from(x)) : !!x.length ? fn(x) : fn([x]);
const frequencies = validateArrayandApply(x => x.reduce((p,v) => {
    p[v] = p[v] || 0;
    p[v] += 1;
    return p;
}, {}));

const partition = (n, step, arr) => {
    const res = [];
    for(let j=0;j<=arr.length-n;j+=step) {        
        res.push(arr.slice(j,j+n));
    }
    return res;
}

const merge_with = (fn) => (...args) => {
    return args.reduce((p,c) => {
        for(key in c) {
            p[key] = fn(p[key] || 0, c[key]);
        } 
        return p;
    });
}

const memoize = (fn) => {
    const cash = {};
    return (...args) => {
        const cashKey = `key-${JSON.stringify(args)}`;
        if(cash[cashKey]) {
            console.log(`From Cash -- ${cash[cashKey]}`);
            return cash[cashKey];
        }
        const val = fn(...args);
        cash[cashKey] = val;
        console.log(`Cash Key Formed with -- ${val}`);
        return val;
    };
}

const summemo = memoize(add);
const submemo = memoize(sub);

// summemo(4,6);
// submemo(4,6);
// summemo(4,6);
// submemo(4,6);






module.exports = {
    addArgs,subArgs,negateArgs,doubleArgs,
    add,sub,mul, div, negate,double,
    isPositive, isNegative, isEven, isOdd, allOk,
    frequencies, partition, merge_with, memoize
};
